class Solution:
    def maxOperations(self, s: str) -> int:
        cnt = 0 
        ret = 0 
        i=0
        while i<len(s):
            if s[i]=='1':
                cnt+=1
                i+=1
            else:
                while i<len(s) and s[i]=='0':
                    i+=1    
                ret+= cnt
        return ret
